import React from "react";
import { Header } from "./styles";
import { GlobalStyles } from "../../styles/GlobalStyles";

const Layout = (props) => {
  return (
    <>
      <GlobalStyles />
      <Header>
        <p>Algooooo</p>
      </Header>
    </>
  );
};
export default Layout;
